:root {
	--background-colour: #0a0a0a;
	--background-colour-lighter-1: #181818;
	--background-colour-lighter-2: #202020;
	--background-colour-lighter-3: #363636;
	--thead-background: linear-gradient(to bottom, #3a3a3a 0%, #171717 100%);
	--tcat-background: #2a2a2a;
	--border: 1px #404040;
	--a-colour: #a7a7a7;
	--a-hover-colour: #ffffff;
	--thread-unread-colour: #dfdfdf;
	--text-colour: #e6e6e6;
	
	--button-filter: brightness(90%) grayscale(100%) contrast(200%) invert(100%);
	
	/* rank colours */
	--rank-member2: #fff;
	--rank-member3: #ccc;
	--rank-motm: #cc00cc;    
	--rank-donator: #00ff00;
	--rank-fmod: #a7a7ff;
	--rank-lmod: #00ffea;
	--rank-dlmod: #ad62ff;
	--rank-smod: #5197ff;
}
